// App.tsx
// App.tsx
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Favorites from './Favorites';
import SearchComponent from './CSearchComponent';
import { FavoritesProvider } from './path-to-your-context/FavoritesContext';

const App: React.FC = () => {
  return (
    <Router>
      <FavoritesProvider>
        <div>
          <Switch>
            <Route path="/favorites">
              <Favorites />
            </Route>
            <Route path="/search">
              <SearchComponent />
            </Route>
          </Switch>
        </div>
      </FavoritesProvider>
    </Router>
  );
};

export default App;
